struct Puzzle {
    words: Vec<Vec<char>>,
    letters: Vec<char>,
    first_letters: Vec<char>,
}

impl Puzzle {
    fn new(input: &str) -> Option<Self> {
        let words: Vec<Vec<char>> = input
            .split(" == ")
            .flat_map(|s| s.split(" + "))
            .map(|s| s.chars().collect())
            .collect();

        let letters: Vec<char> = words
            .iter()
            .flat_map(|word| word.iter())
            .copied()
            .collect::<std::collections::HashSet<_>>()
            .into_iter()
            .collect();

        let first_letters: Vec<char> = words
            .iter()
            .map(|word| word[0])
            .collect::<std::collections::HashSet<_>>()
            .into_iter()
            .collect();

        Some(Self {
            words,
            letters,
            first_letters,
        })
    }

    fn solve(&mut self) -> Option<HashMap<char, u8>> {
        let mut map = HashMap::new();
        let mut used = [false; 10];
        self.backtrack(0, &mut map, &mut used)?;
        Some(map)
    }

    fn backtrack(
        &self,
        index: usize,
        map: &mut HashMap<char, u8>,
        used: &mut [bool; 10],
    ) -> Option<()> {
        if index == self.letters.len() {
            return if self.is_valid(map) { Some(()) } else { None };
        }

        let letter = self.letters[index];
        for digit in 0..10 {
            if used[digit] || (digit == 0 && self.first_letters.contains(&letter)) {
                continue;
            }

            map.insert(letter, digit as u8);
            used[digit] = true;

            if self.backtrack(index + 1, map, used).is_some() {
                return Some(());
            }

            map.remove(&letter);
            used[digit] = false;
        }

        None
    }

    fn is_valid(&self, map: &HashMap<char, u8>) -> bool {
        let words: Vec<Vec<u8>> = self
            .words
            .iter()
            .map(|word| word.iter().map(|c| map.get(c).copied()).collect())
            .collect::<Option<Vec<Vec<u8>>>>()?;

        let numbers: Vec<u64> = words
            .iter()
            .map(|word| {
                word.iter()
                    .fold(0u64, |acc, &digit| acc * 10 + digit as u64)
            })
            .collect();

        let sum: u64 = numbers[..numbers.len() - 1].iter().sum();
        sum == numbers[numbers.len() - 1]
    }
