}

struct Solver {
    cols: Vec<Vec<char>>,
    first_chars: Vec<char>,
    map: HashMap<char, u8>,
    used: u16,
}

impl Solver {
    fn new(input: &str) -> Self {
        let mut cols = Vec::new();
        let mut first_chars = Vec::new();
        let mut map = HashMap::new();
        let words: Vec<&str> = input.split(" == ").collect();
        let left: Vec<&str> = words[0].split(" + ").collect();
        let right = words[1];
        let max_len = right.len();
        for i in 0..max_len {
            let mut col = Vec::new();
            for word in left.iter() {
                if let Some(c) = word.chars().rev().nth(i) {
                    col.push(c);
                }
            }
            if let Some(c) = right.chars().rev().nth(i) {
                col.push(c);
            }
            cols.push(col);
        }
        for word in left {
            if let Some(c) = word.chars().next() {
                first_chars.push(c);
            }
        }
        if let Some(c) = right.chars().next() {
            first_chars.push(c);
        }
        Solver {
            cols,
            first_chars,
            map,
            used: 0,
        }
    }

    fn solve(
        &mut self,
        col: usize,
        row: usize,
        sum: u64,
    ) -> Option<HashMap<char, u8>> {
        if col >= self.cols.len() {
            if sum == 0 {
                return Some(self.map.clone());
            } else {
                return None;
            }
        }
        if row >= self.cols[col].len() {
            if sum % 10 == 0 {
                return self.solve(col + 1, 0, sum / 10);
            } else {
                return None;
            }
        }
        let c = self.cols[col][row];
        if let Some(&digit) = self.map.get(&c) {
            let new_sum = if row == self.cols[col].len() - 1 {
                sum - digit as u64
            } else {
                sum + digit as u64
            };
            self.solve(col, row + 1, new_sum)
        } else {
            let start = if self.first_chars.contains(&c) { 1 } else { 0 };
            for digit in start..=9 {
                if self.used & (1 << digit) != 0 {
                    continue;
                }
                self.map.insert(c, digit);
                self.used |= 1 << digit;
                let new_sum = if row == self.cols[col].len() - 1 {
                    sum - digit as u64
                } else {
                    sum + digit as u64
                };
                if let Some(solution) = self.solve(col, row + 1, new_sum) {
                    return Some(solution);
                }
                self.map.remove(&c);
                self.used &= !(1 << digit);
            }
            None
        }
    }
}
