struct Puzzle {
    letters: Vec<char>,
    first_letters: Vec<char>,
    left: Vec<Vec<char>>,
    right: Vec<char>,
}

impl Puzzle {
    fn new(input: &str) -> Option<Self> {
        let parts: Vec<&str> = input.split("==").collect();
        if parts.len() != 2 {
            return None;
        }

        let left: Vec<&str> = parts[0].split('+').map(|s| s.trim()).collect();
        let right = parts[1].trim();

        let mut first_letters: Vec<char> = left.iter().map(|s| s.chars().next().unwrap()).collect();
        first_letters.push(right.chars().next().unwrap());
        let first_letters = first_letters;

        let left: Vec<Vec<char>> = left.iter().map(|s| s.chars().collect()).collect();
        let right: Vec<char> = right.chars().collect();

        let mut letters: Vec<char> = left
            .iter()
            .flat_map(|word| word.iter())
            .chain(right.iter())
            .copied()
            .collect::<std::collections::HashSet<_>>()
            .into_iter()
            .collect();

        letters.sort();

        Some(Self {
            first_letters,
            left,
            right,
            letters,
        })
    }

    fn solve(&mut self) -> Option<HashMap<char, u8>> {
        let mut map = HashMap::new();
        let mut used = [false; 10];
        if self.backtrack(0, &mut map, &mut used) {
            Some(map)
        } else {
            None
        }
    }

    fn backtrack(
        &self,
        index: usize,
        map: &mut HashMap<char, u8>,
        used: &mut [bool; 10],
    ) -> bool {
        if index == self.letters.len() {
            return self.is_valid(map);
        }

        let letter = self.letters[index];
        for digit in 0..10 {
            if used[digit] {
                continue;
            }

            if digit == 0 && self.first_letters.contains(&letter) {
                continue;
            }

            map.insert(letter, digit as u8);
            used[digit] = true;

            if self.backtrack(index + 1, map, used) {
                return true;
            }

            map.remove(&letter);
            used[digit] = false;
        }

        false
    }

    fn is_valid(&self, map: &HashMap<char, u8>) -> bool {
        let left_sum: u64 = self.left
            .iter()
            .map(|word| {
                word.iter()
                    .fold(0, |acc, &c| acc * 10 + *map.get(&c).unwrap() as u64)
            })
            .sum();

        let right_value: u64 = self.right
            .iter()
            .fold(0, |acc, &c| acc * 10 + *map.get(&c).unwrap() as u64);

        left_sum == right_value
    }
}
