typedef struct nodo{
   void* data;
   int priority;
}heapElem;

typedef struct Heap{
  heapElem* heapArray;
  int size;
  int capac;
} Heap;


void* heap_top(Heap* pq){
  if(pq->size == 0) return NULL;
  return pq->heapArray[0].data;
}

void heap_push(Heap* pq, void* data, int priority){
  if(pq->size == pq->capac){
    pq->capac = pq->capac * 2 + 1;
    pq->heapArray = realloc(pq->heapArray, pq->capac * sizeof(heapElem));
  }
  int pos = pq->size;
  pq->heapArray[pos].data = data;
  pq->heapArray[pos].priority = priority;
  pq->size++;
  heapElem aux;
  while(pos > 0){
    int padre = (pos-1)/2;
    if(pq->heapArray[pos].priority > pq->heapArray[padre].priority){
      aux = pq->heapArray[padre];
      pq->heapArray[padre] = pq->heapArray[pos];
      pq->heapArray[pos] = aux;
      pos = padre;
    }else{
      break;
    }
  }
}

void heap_pop(Heap* pq){
  pq->heapArray[0] = pq->heapArray[pq->size-1];
  pq->size--;
  int pos = 0;
  heapElem aux;
  while(1){
    int hijoIzq = 2*pos+1;
    int hijoDer = 2*pos+2;
    int hijoMayor = pos;
    if(hijoIzq < pq->size && pq->heapArray[hijoIzq].priority > pq->heapArray[hijoMayor].priority){
      hijoMayor = hijoIzq;
    }
    if(hijoDer < pq->size && pq->heapArray[hijoDer].priority > pq->heapArray[hijoMayor].priority){
      hijoMayor = hijoDer;
    }
    if(hijoMayor == pos) break;
    aux = pq->heapArray[pos];
    pq->heapArray[pos] = pq->heapArray[hijoMayor];
    pq->heapArray[hijoMayor] = aux;
    pos = hijoMayor;
  }
}

Heap* createHeap(){
  Heap* heap = (Heap*) malloc(sizeof(Heap));
  heap->heapArray = (heapElem*) malloc(3 * sizeof(heapElem));
  heap->size = 0;
  heap->capac = 3;
  return heap;
}
