typedef struct List
{
    int val;
    struct List *next;
} List;

List *list_init(int val)
{
    List *tmp = (List*)malloc(sizeof(List));
    tmp->val = val;
    tmp->next = NULL;
    return tmp;
}

List *list_push(List *list, int val)
{
    List *tmp = list_init(val);
    tmp->next = list;
    return tmp;
}

List *list_find(List *list, int val)
{
    List *tmp = list;
    while(tmp)
    {
        if(tmp->val == val) return tmp;
        tmp = tmp->next;
    }
    return NULL;
}

List *list_find_prev(List *list, int val)
{
    List *tmp = list;
    while(tmp->next)
    {
        if(tmp->next->val == val) return tmp;
        tmp = tmp->next;
    }
    return NULL;
}

List *list_append(List *list, int val)
{
    List *tmp = list;
    while(tmp->next)
    {
        tmp = tmp->next;
    }
    tmp->next = list_init(val);
    return list;
}

List *list_remove(List *list, int val)
{
    List *tmp = list;
    if(tmp->val == val)
    {
        list = list->next;
        free(tmp);
        return list;
    }
    List *prev = list_find_prev(list, val);
    if(prev)
    {
        tmp = prev->next;
        prev->next = tmp->next;
        free(tmp);
    }
    return list;
}

void list_print(List *list)
{
    List *tmp = list;
    while(tmp)
    {
        printf("%d ", tmp->val);
        tmp = tmp->next;
    }
    printf("\n");
}

void list_destroy(List *list)
{
    List *tmp;
    while(list)
    {
        tmp = list;
        list = list->next;
        free(tmp);
    }
}

